import React, { Fragment, useState } from "react";

import Item from "./Item";

const ItemsList = (props) => {
  const [events, setEvents] = useState([]);
  const arr = [
    { id: 0, name: "Test", date: "TestDate" },
    { id: 1, name: "Test", date: "TestDate" },
    { id: 2, name: "Test", date: "TestDate" },
    { id: 3, name: "Test", date: "TestDate" },
  ];

  function fetchData() {
    fetch("https://event-task-f2694-default-rtdb.firebaseio.com/events.json")
      .then((response) => {
        return response.json();
      })
      .then((data) => {
        setEvents(data.results);
      });
  }


  fetchData();

  return (
    <Fragment>
      {arr.map((item) => (
        <Item key={item.id} obj={item} />
      ))}
    </Fragment>
  );
};



export default ItemsList;
